import React, { Component } from 'react';
import './App.css';

const profilepic = <img src="./jackson.jpeg"></img>

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Ticket</h1>
        </header>
        <p className="App-intro">
        {profilepic}
        </p>
      </div>
    );
  }
}

export default App;
